import "../styles/Landing.css";


const Landing = () => {
  return (
    <div className="landing-container">

  <img
    src={process.env.PUBLIC_URL + "/images/robot-eye.png"}
    className="background-image"
    alt="AI Eye"
  />

  <div className="welcome-card">

    <h1 className="system-title">FocusMate</h1>
    <p className="system-subtitle">
      Please start the monitoring system
    </p>

    <div className="fake-input">System access enabled</div>
    <div className="fake-input">AI vision ready</div>

    <button className="start-btn">
      Start Monitoring
    </button>

    <div className="footer-text">
      AI-Powered platform for monitoring student attention during lectures.
    </div>

  </div>
</div>

  );
};

export default Landing;
